import './App.css';
import logo from './logo.svg';

const Intro = () => {
    return (
      <div className="intro">
      <img src={logo} className="App-logo" alt="logo" />
      <p>
        Edit <code>src/App.js</code> and save to reload. This is project to learn ReactJS.
      </p>
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>
    </div>
    )
  }

  export default Intro;
